import React from 'react'
import {Switch, Route} from 'react-router-dom'
import Home from './pages/Home/Home'
import Auth from './pages/Auth/Auth'
function Routes() {
  return (
    
        <switch>

        <Route exact path='/' component={Home} />
        </switch>
        
  )
}

export default Routes
